import React from "react";
import { Container } from "@chakra-ui/react";
import { Button, ButtonGroup, Center, Square, Circle, Box } from '@chakra-ui/react';



const Landing = () => {
  return (
    <div>
    <box> <Button colorScheme='blue'>Login/Signup</Button></box>
    
    <center >
     
      <header> Fantastic Happiness!</header>

    </center>
    </div>
  );
};

export default Landing;
